ợc làm từ nguyên liệu sứ, lõi kim loại giúp dẫn nhiệt rất nhanh và chuẩn \r\nLư điện dùng điện 220V hợp với hệ thống điện của mọi nhà\r\nLư điện tinh xảo và sạng trọng phù hợp với mọi không gian\r\nSản phẩm thích hợp cho việc xông vụn trầm, giác trầm, bột trầm\r\nNhiệt độ xông từ 130-170 tùy vào mật độ hương cần dùng \r\nSản phẩm có hộp đi kèm giúp bảo vệ tốt hơn,đồng thời dễ dàng biếu tặng .','<h2><strong>Nguy&ecirc;n liệu l&agrave;m bằng sứ&nbsp;bền đẹp, tiện lợi,&nbsp;sang trọng</strong></h2>\r\n<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu&nbsp;<strong>dụng cụ Trầm Hương</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng. Lư được l&agrave;m bằng sứ chất lượng tốt,d&agrave;y chắc,m&agrave;u sắc&nbsp;đẹp, hoa văn tr&ecirc;n lư&nbsp;được in nổi chi tiết.Nhiệt độ lan toả đều,vừa đủ gi&uacute;p cho&nbsp;<strong><em>Bột Trầm Hương</em></strong>&nbsp;được toả m&ugrave;i thơm chuẩn ngọt dịu,kh&ocirc;ng kh&oacute;i kh&ocirc;ng ngộp như kiểu đốt lửa th&ocirc;ng thường. Lư điện x&ocirc;ng sang trọng,tinh tế,ph&ugrave; hợp với mọi kh&ocirc;ng gian từ b&agrave;n thờ Gia Ti&ecirc;n cho đến b&agrave;n tr&agrave; đạo v&agrave; kể cả việc ngồi Thiền.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/ld-1.jpg?v=1672834566096\" alt=\"lư điện x&ocirc;ng trầm cao cấp\" data-thumb=\"original\" /></p>',NULL,'sanpham01-643816ab1064c.png','LD02',1,900000.00,0.00,0,0,'public',' 4,',1,0,0,0,6,'2023-04-13 14:43:17','2023-04-18 07:57:32',5),(18,16,4,'LƯ XÔNG ĐIỆN TRẦM HƯƠNG ĐẸP ( SEN )','lu-xong-dien-tram-huong-dep-sen','standard','Sản phẩm lư điện xông bột trầm được làm từ nguyên liệu sứ, lõi kim loại giúp dẫn nhiệt rất nhanh và chuẩn\r\nLư điện dùng điện 220V hợp với hệ thống điện của mọi nhà\r\nLư điện tinh xảo và sạng trọng phù hợp với mọi không gian\r\nSản phẩm thích hợp cho việc xông vụn trầm, giác trầm, bột trầm\r\nNhiệt độ xông từ 130-170 tùy vào mật độ hương cần dùng \r\nSản phẩm có hộp đi kèm giúp bảo vệ tốt hơn,đồng thời dễ dàng biếu tặng .','<h2><strong>Nguy&ecirc;n liệu l&agrave;m bằng sứ&nbsp;bền đẹp, tiện lợi,&nbsp;sang trọng</strong></h2>\r\n<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu&nbsp;<strong>dụng cụ Trầm Hương</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng. Lư được l&agrave;m bằng sứ chất lượng tốt,d&agrave;y chắc,m&agrave;u sắc&nbsp;đẹp, hoa văn tr&ecirc;n lư&nbsp;được in nổi chi tiết.Nhiệt độ lan toả đều,vừa đủ gi&uacute;p cho&nbsp;<strong><em>Bột Trầm Hương</em></strong>&nbsp;được toả m&ugrave;i thơm chuẩn ngọt dịu,kh&ocirc;ng kh&oacute;i kh&ocirc;ng ngộp như kiểu đốt lửa th&ocirc;ng thường. Lư điện x&ocirc;ng sang trọng,tinh tế,ph&ugrave; hợp với mọi kh&ocirc;ng gian từ b&agrave;n thờ Gia Ti&ecirc;n cho đến b&agrave;n tr&agrave; đạo v&agrave; kể cả việc ngồi Thiền.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/ld-1.jpg?v=1672834566096\" alt=\"lư điện x&ocirc;ng trầm cao cấp\" data-thumb=\"original\" /></p>',NULL,'sanpham02-64381a906ae19.png','LD02-Sen',1,900000.00,0.00,0,0,'public',' 4,',1,0,0,0,7,'2023-04-13 15:06:56','2023-04-16 08:07:53',5),(19,16,4,'NHANG NỤ TRẦM HƯƠNG TỰ NHIÊN','nhang-nu-tram-huong-tu-nhien','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm nhang nụ được làm từ nguyên liệu Trầm Hương thiên nhiên\r\nSản phẩm có mùi ngọt dịu nhẹ thanh mát , lưu lượng khói dịu nhẹ không cay gắt , tạo cảm giác thoải mái thư giãn và an lành.\r\nSản phẩm có kích thước 2 cm , cháy từ 8 đến 10 phút \r\nNhang nụ thích hợp cho không gian ít gió , diện tích khoảng 30m2\r\nMỗi hộp nhang nụ sẽ có trung bình 80 viên , được đóng hộp giấy vừa vặn , giữ hương tốt .','<p>Bởi t&iacute;nh chất nhang nụ cũng l&agrave;m từ bột trầm tự nhi&ecirc;n , đặc biệt l&agrave; h&igrave;nh d&aacute;ng nhỏ gọn tiện dụng , độ nguy&ecirc;n chất cao v&igrave; kh&ocirc;ng c&oacute; l&otilde;i tăm tre , v&igrave; vậy chất hương của nhang nụ c&oacute; phần ngọt ổn định hơn , lượng kh&oacute;i cũng nhẹ nh&agrave;ng hơn . Ch&iacute;nh v&igrave; vậy m&agrave; nhang nụ được nhiều người sử dụng kh&ocirc;ng những trong kh&ocirc;ng gian thờ c&uacute;ng , m&agrave; c&ograve;n cả kh&ocirc;ng gian sinh hoạt b&igrave;nh thường c&oacute; diện t&iacute;ch tho&aacute;ng .</p>\r\n<p>Song h&agrave;nh c&ugrave;ng nhang nụ th&igrave; chắc chắn phải kể đến&nbsp;<strong>Lư đồng</strong>&nbsp;- một vật phẩm đ&atilde; rất quen thuộc trong k&iacute; ức của người Việt ch&uacute;ng ta . Việc nhang nụ trầm ng&agrave;y nay đ&atilde; linh hoạt sử dụng rộng r&atilde;i hơn cho nhiều kh&ocirc;ng gian , v&igrave; vậy lư đồng cũng dần xuất hiện những mẫu đẹp hơn , nhỏ gọn , tiện dụng , nhưng vẫn giữ v&agrave; kết hợp được những đường n&eacute;t cổ điển mộc mạc quen thuộc của văn ho&aacute; phương Đ&ocirc;ng .</p>\r\n<p><br /><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nhang-nu-va-lu.jpg?v=1664969337510\" alt=\"nhang nụ trầm hương. lư đồng x&ocirc;ng nhang nụ\" data-thumb=\"original\" /></p>',NULL,'sanpham03-64381be633fd1.png','NNCC1',1,450000.00,0.00,0,0,'public',' 4,',1,0,0,0,18,'2023-04-13 15:11:35','2023-04-16 08:10:02',5),(20,16,4,'NHANG CÓ TĂM TRẦM HƯƠNG CAO CẤP 2','nhang-co-tam-tram-huong-cao-cap-2','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm vòng tay được làm từ nguyên liệu Trầm Hương thiên nhiên hiếm và có độ dầu cao. \r\nSản phẩm có mùi ngọt dịu nhẹ thanh mát tạo cảm giác thoải mái thư giãn và an lành.\r\nMôi ống nhang 250gram , có khoảng 260 cây nhang\r\nMỗi cây nhang dài 30cm , cháy khoảng 40 phút trong không gian ít gió\r\nSản phẩm bán ra được tặng kèm hộp giấy sang trọng và tinh tế\r\nKhách lấy theo Kg sẽ được ưu đãi .','<p>Hương V&acirc;n C&aacute;t chỉ&nbsp;nhập nguy&ecirc;n liệu v&agrave; sản xuất tận xưởng&nbsp;<strong>nhang tăm&nbsp;Trầm Hương thi&ecirc;n nhi&ecirc;n</strong>&nbsp;, v&igrave; thế&nbsp;đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng trong từng l&ocirc; nhang trầm , mọi người khi đến với Hương V&acirc;n C&aacute;t c&oacute; thể an t&acirc;m về mọi sản phẩm trầm hương của cửa h&agrave;ng&nbsp;. Nhang trầm c&oacute; tăm l&agrave; sản phẩm được sử dụng mỗi ng&agrave;y trong&nbsp;<strong>văn h&oacute;a thờ c&uacute;ng</strong>&nbsp;của người Việt ch&uacute;ng ta , n&ecirc;n việc chọn lựa sản phẩm nhang trầm chất lượng , tốt cho kh&ocirc;ng gian , sức khỏe người th&acirc;n v&agrave; bản th&acirc;n l&agrave; điều rất cần thiết .</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/tram-vun-5929e3b5-e463-4d4c-b18c-5e54003af4c7.jpg?v=1663240772503\" alt=\"nguy&ecirc;n liệu trầm tự nhi&ecirc;n l&agrave;m nhang trầm sạch\" data-thumb=\"original\" /></p>',NULL,'sanpham04-64381cb9bacc6.png','NCT2',1,1200000.00,0.00,0,0,'public',' 4,',1,0,0,0,38,'2023-04-13 15:16:09','2023-04-16 08:09:09',5),(21,16,4,'NHANG TRẦM HƯƠNG KHÔNG TĂM','nhang-tram-huong-khong-tam','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm nhang được làm từ nguyên liệu Trầm Hương có chất lượng tốt và an toàn với sức khỏe\r\nSản phẩm có mùi ngọt ấm dịu nhẹ , không cay mắt , không ngộp khí , lưu hương rất dễ chịu và lâu trong phòng kín\r\nMỗi ống nhang có hơn 100 cây nhang ,  kích thước 20cm ,cháy từ 20 đến 25 phút trong không gian ít gió\r\nSản phẩm được đựng trong hộp gỗ muồng  đẹp , giúp nhang được bao quản tốt và không bị ám mùi lạ.','<p>Nhang trầm kh&ocirc;ng tăm được sản xuất từ bột trầm hương nguy&ecirc;n chất cao cấp. Sản phẩm sau đ&oacute; được kết d&iacute;nh c&ugrave;ng với keo c&acirc;y bời lời m&agrave; kh&ocirc;ng c&oacute; sự pha trộn của bất kỳ một th&agrave;nh phần hương liệu n&agrave;o kh&aacute;c. Nhang kh&ocirc;ng tăm sinh ra để tạo hương thơm mộc mạc , trầm ấm&nbsp;, g&oacute;p phần l&agrave;m thanh tịnh kh&ocirc;ng gian nh&agrave; . &nbsp;</p>\r\n<p>Điểm kh&aacute;c biệt của sản phẩm n&agrave;y nằm ở chỗ th&agrave;nh phần chỉ gồm bột trầm hương kết th&agrave;nh dạng que chứ kh&ocirc;ng c&oacute; l&otilde;i tăm tre b&ecirc;n trong. Với kết cấu kh&ocirc;ng tăm, người chơi trầm được thưởng thức trọn vẹn hương thơm ngọt của&nbsp;<strong>gỗ trầm</strong>&nbsp;m&agrave; kh&ocirc;ng c&oacute; m&ugrave;i kh&eacute;t của tăm. Một que nhang c&oacute; thể ch&aacute;y được trong khoảng 25 ph&uacute;t trong m&ocirc;i trường &iacute;t gi&oacute; , độ tỏa hương hợp l&yacute; trong tầm 20m2 .&nbsp;</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/tram-vun-09fd54b7-c7ec-4e18-a5de-7b30e2ff6df7.jpg?v=1663237587957\" alt=\"NGUY&Ecirc;N LIỆU TRẦM HƯƠNG TỰ NHI&Ecirc;N\" data-thumb=\"original\" /></p>',NULL,'sanpham05-64381d39e4122.png','NKT1',1,300000.00,0.00,0,0,'public',' 4,',1,0,0,0,46,'2023-04-13 15:18:18','2023-04-16 08:10:29',5),(22,16,4,'LƯ ĐỒNG XÔNG NHANG NỤ CAO CẤP','lu-dong-xong-nhang-nu-cao-cap','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm lư đồng xông nhang trầm được làm từ nguyên liệu đồng chất lượng tốt , màu bền đẹp theo thời gian\r\nSản phẩm tinh xảo và sạng trọng phù hợp với mọi không gian phòng và cả không gian thờ cúng\r\nBên trong lư có tặng kèm 1 chân cắm nhang tăm và nhang vòng tiện lợi\r\nKích thước lòng lư để nhang nụ , nhang vòng : cao 4,5cm , ngang 7cm\r\nKích thước toàn bộ lư từ đỉnh nắp đến chân trụ : 8,5cm x 9cm','<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu&nbsp;<strong>dụng cụ Trầm Hương</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng. Lư được đ&uacute;c bằng đồng nguy&ecirc;n chất,d&agrave;y chắc,m&agrave;u sắc giả cổ đẹp, hoa văn tr&ecirc;n lư&nbsp;được khắc tỉ mỉ, tinh tế v&agrave; c&oacute; độ ho&agrave;n thiện cao gi&uacute;p nhang trầm th&ocirc;ng kh&iacute; v&agrave; toả hương tốt hơn.Lư đồng x&ocirc;ng nhang sanng trọng,tinh tế,ph&ugrave; hợp với mọi kh&ocirc;ng gian từ b&agrave;n thờ Gia Ti&ecirc;n cho đến b&agrave;n tr&agrave; đạo v&agrave; kể cả việc ngồi Thiền.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/l02-1.jpg?v=1663243737818\" alt=\"lư đồng x&ocirc;ng nhang nụ\" data-thumb=\"original\" /></p>',NULL,'sanpham06-64381dcee7706.png','L03',1,500000.00,0.00,0,0,'public',' 4,',1,0,0,0,22,'2023-04-13 15:20:47','2023-04-16 08:10:55',5),(23,16,4,'MẶT TRẦM CẬN CHÌM KHẮC TỲ HƯU CAO CẤP','mat-tram-can-chim-khac-ty-huu-cao-cap','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm được chọn lọc từ nguyên liệu trầm hương chất lượng và quý hiếm\r\nSản phẩm có chất lượng dầu cao thứ 2 trong chất dầu trầm tự nhiên sau chất Chìm Nước\r\nVới tông mùi ngọt sâu đằm rất giá trị , kiểu mùi chỉ có ở vùng Thổ Dưỡng tốt và chất trầm phải già cũ rất hiếm\r\nVới kiểu dáng tự nhiên độc đáo , chạm khắc Tỳ Hưu rất nét và đầy đủ\r\nSản phẩm có thể sưu tầm hoặc bọc vàng làm mặt trầm','<p>Mang trong m&igrave;nh một vẻ đẹp mộc mạc nhưng chứa đựng v&ocirc; v&agrave;n sự&nbsp;tinh tế&nbsp;của tạo h&oacute;a . Nghe&nbsp;đến Trầm Hương , ch&uacute;ng ta đ&atilde; cảm nhận sự điềm đạm , s&acirc;u sắc , v&agrave; một ch&uacute;t g&igrave; đ&oacute; t&ocirc;n nghi&ecirc;m ngay từ ch&iacute;nh c&aacute;i t&ecirc;n m&agrave; người xưa đ&atilde; đặt cho một loại gỗ qu&yacute; n&agrave;y .</p>\r\n<p><img style=\"height: 563px; width: 1000px;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nguyen-lieu-4-c74628b6-2300-46de-9054-f758c3483fc9.jpg?v=1671544257013\" alt=\"NGUY&Ecirc;N LIỆU TRẦM CH&Igrave;M\" data-thumb=\"original\" /></p>',NULL,'sanpham07-64381eca13318.png','MTC15',1,25000000.00,0.00,0,0,'public',' 4,',1,0,0,0,1,'2023-04-13 15:24:58','2023-04-16 08:11:21',5),(24,16,4,'VỤN TRẦM HƯƠNG KIẾN CAO CẤP ( GIÁ TÍNH THEO MỖI 10 GRAM )','vun-tram-huong-kien-cao-cap-gia-tinh-theo-moi-10-gram','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm Trầm xông rục,độ dầu cao,màu nâu đen.\r\nSản phẩm vụn Trầm Hương làm từ nguyên liệu Trầm Hương thiên nhiên hiếm và có độ dầu cao. \r\nSản phẩm có mùi ngọt dịu nhẹ thanh mát tạo cảm giác thoải mái thư giãn và an lành.\r\nSản phẩm được chọn lọc và vệ sinh sạch,giúp cho quá trình xông đốt được dễ dàng,mùi hương đạt đến độ ngọt chuẩn nhất','<h2><img style=\"height: 675px; width: 900px;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nguyen-lieu-lam-nhang-thien-nhien-2-jpeg.jpg?v=1631808282817\" alt=\"Nguy&ecirc;n liệu l&agrave;m nhang Trầm Hương thi&ecirc;n nhi&ecirc;n\" data-thumb=\"original\" /></h2>\r\n<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu&nbsp;<strong>vụn&nbsp;Trầm Hương thi&ecirc;n nhi&ecirc;n</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng.&nbsp;C&ocirc;ng ty ch&uacute;ng t&ocirc;i chỉ nhập nguy&ecirc;n liệu l&agrave; Trầm Hương chuẩn thi&ecirc;n nhi&ecirc;n n&uacute;i rừng n&ecirc;n rất tốt cho sức khỏe, gi&uacute;p hỗ trợ&nbsp;an thần, thư gi&atilde;n, giảm căng thẳng stress.</p>',NULL,'sanpham08-6438212e4f6a3.png','TV01',1,2500000.00,0.00,0,0,'public',' 4,',1,0,0,0,99,'2023-04-13 15:35:10','2023-04-16 08:11:55',5),(25,16,4,'BỘT TRẦM HƯƠNG TỰ NHIÊN ( 1 HŨ 50GRAM )','bot-tram-huong-tu-nhien-1-hu-50gram','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm bột Trầm Hương làm từ nguyên liệu Trầm Hương thiên nhiên hiếm và có độ dầu cao. \r\nSản phẩm có mùi ngọt mạnh bốc khi đốt , mùi ngọt dịu ấm khi xông trên lư điện\r\nSản phẩm được chọn lọc và xay nhuyễn,mịn,giúp cho quá trình xông đốt được dễ dàng,mùi hương đạt đến độ ngọt chuẩn nhất\r\nBột trầm cao cấp khi kết hợp với Lư Điện sẽ cho hương thơm ngọt rất tốt và tiết kiệm hơn nhiều\r\nSản phẩm bán ra được tặng kèm hộp đựng an toàn.','<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu<strong>&nbsp;bột&nbsp;Trầm Hương thi&ecirc;n nhi&ecirc;n</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng.&nbsp;C&ocirc;ng ty ch&uacute;ng t&ocirc;i chỉ nhập nguy&ecirc;n liệu l&agrave; Trầm Hương chuẩn thi&ecirc;n nhi&ecirc;n n&uacute;i rừng n&ecirc;n rất tốt cho sức khỏe, gi&uacute;p hỗ trợ&nbsp;an thần, thư gi&atilde;n, giảm căng thẳng stress.</p>\r\n<h2><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/tram-vun-fca5ccdf-8e18-4e26-a2ae-a868b4bfa52f.jpg?v=1663244391793\" alt=\"nguy&ecirc;n liệu trầm l&agrave;m nhang\" data-thumb=\"original\" /></h2>',NULL,'sanpham09-643821a2d83cc.png','BT01',1,750000.00,0.00,0,0,'public',' 4,',1,0,0,0,52,'2023-04-13 15:37:07','2023-04-13 15:46:43',5),(26,16,4,'HỘP XÔNG NHANG TRẦM HƯƠNG KHÔNG TĂM','hop-xong-nhang-tram-huong-khong-tam','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm hộp xông nhang trầm hương không tăm được làm từ nguyên liệu gỗ muồng thiên nhiên\r\nChất liệu gỗ ít mùi , nên xông nhang trầm sẽ giữ được độ nguyên vẹn của hương trầm\r\nSản phẩm được gia công tỉ mỉ và tinh tế , có khắc hoa văn đẹp giúp hương nhang tỏa ra tốt hơn\r\nSử dụng 1 thời gian phần nắp hộp sẽ có lớp dầu trầm đen bám vào , giúp hộp gỗ thơm hơn','<h2><strong>Nguy&ecirc;n liệu l&agrave;m bằng gỗ nguy&ecirc;n khối bền đẹp, tiện lợi,&nbsp;sang trọng</strong></h2>\r\n<h2><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/banner-hop-xong-tram.jpg?v=1645795380315\" alt=\"hộp x&ocirc;ng trầm nhang kh&ocirc;ng tăm\" data-thumb=\"original\" /></h2>\r\n<p>Hương V&acirc;n C&aacute;t nhập nguy&ecirc;n liệu&nbsp;<strong>dụng cụ Trầm Hương</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng. Hộp c&oacute; h&igrave;nh hộp chữ nhật vu&ocirc;ng vức v&agrave; sắc xảo, c&oacute; nam ch&acirc;m h&uacute;t tiện lợi để kh&ocirc;ng bị rơi nắp, hoa văn tr&ecirc;n hộp được khắc tỉ mỉ, tinh tế v&agrave; c&oacute; độ ho&agrave;n thiện cao gi&uacute;p nhang trầm th&ocirc;ng kh&iacute; v&agrave; toả hương tốt hơn. Hộp được l&agrave;m từ nguy&ecirc;n liệu gỗ nguy&ecirc;n khối n&ecirc;n rất sang trọng, gi&aacute; trị, bền bỉ qua thời gian v&agrave; ph&ugrave; hợp với mọi kh&ocirc;ng gian sống.</p>',NULL,'sanpham10-643822242bcbb.png','HXT',1,150000.00,0.00,0,0,'public',' 4,',1,0,0,0,127,'2023-04-13 15:39:16','2023-04-13 15:47:08',5),(27,16,4,'VÒNG TRẦM HƯƠNG 108 HẠT RỤC CẬN CHÌM MALAY 6,5 LI','vong-tram-huong-108-hat-ruc-can-chim-malay-65-li','standard','THÔNG TIN SẢN PHẨM\r\nVòng tay được làm từ nguyên liệu Trầm chìm tự nhiên và ra cận chìm, xuất sứ Malaysia\r\nSản phẩm có màu nâu đen ánh đỏ nhẹ , hương ngọt rất tốt , thoảng hương ngọt béo sữa rất tốt khi ngửi sâu\r\nSản phẩm được gia công tỉ mỉ, size hạt tròn 6,5 li rất đẹp\r\nMỗi dây trầm có trọng lượng trung bình 11 gr , trọng lượng trầm rục chìm chuẩn gần 16gr là chìm nước\r\nTrầm rục cao cấp đeo lâu sẽ ánh đỏ nhiều hơn , điều kiện cần đeo và bảo quản tốt','<p>Hương V&acirc;n C&aacute;t&nbsp;nhập 100%&nbsp;nguy&ecirc;n liệu&nbsp;<strong>Trầm Hương thi&ecirc;n nhi&ecirc;n</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng, n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng . Ch&uacute;ng t&ocirc;i chỉ nhập nguy&ecirc;n liệu Trầm Hương c&oacute; chất lượng ph&ocirc;i tốt,&nbsp;hương thơm ngọt đạt chuẩn, kh&ocirc;ng l&agrave;m h&agrave;ng non, h&agrave;ng tận dụng xấu.</p>\r\n<p>V&igrave;&nbsp;t&ocirc;n trọng vẻ đẹp tự nhi&ecirc;n của v&ograve;ng tay trầm, n&ecirc;n c&aacute;c sản phẩm Trầm Hương của&nbsp;ch&uacute;ng t&ocirc;i kh&ocirc;ng c&oacute; xử l&yacute; th&ecirc;m s&aacute;p l&agrave;m sậm hay thủ thuật h&oacute;a chất&nbsp;, n&ecirc;n 100% sản phẩm trầm hương đều an to&agrave;n, chất lượng để mọi người trải nghiệm r&otilde; r&agrave;ng&nbsp;nhất, cảm x&uacute;c nhất trong sự thay đổi&nbsp;của v&acirc;n trầm, sớ gỗ, hương thơm qua&nbsp;mỗi ng&agrave;y.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nguyen-lieu-ruc-can-chim.jpg?v=1670588521434\" alt=\"nguy&ecirc;n liệu trầm rục cận ch&igrave;m\" data-thumb=\"original\" /></p>',NULL,'sanpham23-64382483b7d85.png','VQL07Y',1,23000000.00,0.00,0,0,'public',' 4,',1,0,0,0,5,'2023-04-13 15:49:23','2023-04-16 08:12:49',5),(28,16,4,'VÒNG TAY TRẦM HƯƠNG CHO NỮ TRÒN CẬN CHÌM 7 LI MIX CHARM VÀNG