-chim-khac-quan-the-am-cao-cap-2','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm được chọn lọc từ nguyên liệu trầm hương chất lượng và quý hiếm\r\nSản phẩm có chất lượng dầu cao nhất trong chất dầu trầm tự nhiên là Chìm Nước , độ cứng chắc rất cao\r\nVới tông mùi ngọt sâu đằm rất giá trị , kiểu mùi chỉ có ở vùng Thổ Dưỡng tốt và chất trầm phải già cũ rất hiếm\r\nVới kiểu dáng tự nhiên độc đáo , mặt trầm bọc móc vàng 18k đẹp và thuận tiện đeo cổ\r\nSản phẩm khi bán ra sẽ kèm lọ , vụn trầm , hộp đựng an toàn và sang trọng','<h1><strong>NGUY&Ecirc;N LIỆU TRẦM HƯƠNG CAO CẤP</strong></h1>\r\n<p>Mang trong m&igrave;nh một vẻ đẹp mộc mạc nhưng chứa đựng v&ocirc; v&agrave;n sự&nbsp;tinh tế&nbsp;của tạo h&oacute;a . Nghe&nbsp;đến Trầm Hương , ch&uacute;ng ta đ&atilde; cảm nhận sự điềm đạm , s&acirc;u sắc , v&agrave; một ch&uacute;t g&igrave; đ&oacute; t&ocirc;n nghi&ecirc;m ngay từ ch&iacute;nh c&aacute;i t&ecirc;n m&agrave; người xưa đ&atilde; đặt cho một loại gỗ qu&yacute; n&agrave;y .</p>\r\n<p><img style=\"height: 563px; width: 1000px;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nguyen-lieu-4-c74628b6-2300-46de-9054-f758c3483fc9.jpg?v=1671544257013\" alt=\"NGUY&Ecirc;N LIỆU TRẦM CH&Igrave;M\" data-thumb=\"original\" /></p>',NULL,'sanpham26-643827b2e0550.png','MTC11',1,48000000.00,0.00,0,0,'public',' 4,',1,0,0,0,1,'2023-04-13 16:02:59','2023-04-16 08:15:06',5),(31,16,4,'MẶT TRẦM CHÌM KHẮC QUAN THẾ ÂM CAO CẤP 1','mat-tram-chim-khac-quan-the-am-cao-cap-1','standard','THÔNG TIN SẢN PHẨM\r\nSản phẩm được chọn lọc từ nguyên liệu trầm hương chất lượng và quý hiếm\r\nSản phẩm có chất lượng dầu cao nhất trong chất dầu trầm tự nhiên là Chìm Nước , độ cứng chắc rất cao\r\nVới tông mùi ngọt sâu đằm rất giá trị , kiểu mùi chỉ có ở vùng Thổ Dưỡng tốt và chất trầm phải già cũ rất hiếm\r\nVới kiểu dáng tự nhiên độc đáo , mặt trầm bọc móc vàng 18k đẹp và thuận tiện đeo cổ\r\nSản phẩm khi bán ra sẽ kèm lọ , vụn trầm , hộp đựng an toàn và sang trọng','<h1><strong>NGUY&Ecirc;N LIỆU TRẦM