ve;n, chất lượng để mọi người trải nghiệm r&otilde; r&agrave;ng&nbsp;nhất, cảm x&uacute;c nhất trong sự thay đổi&nbsp;của v&acirc;n trầm, sớ gỗ, hương thơm qua&nbsp;mỗi ng&agrave;y.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/nguyen-lieu-tram-huong-chim-nuoc-2e3c3ef3-e641-44f0-acaa-e2c01e13dc16.jpg?v=1658117747118\" alt=\"ph&ocirc;i trầm ch&igrave;m\" data-thumb=\"original\" /></p>',NULL,'sanpham30-643829cae7607.png','VTC02',1,180000000.00,0.00,0,0,'public',' 4,',1,0,0,0,1,'2023-04-13 16:11:55','2023-04-16 08:18:21',5),(35,16,4,'VÒNG TAY TRẦM HƯƠNG LU THỐNG CẬN CHÌM SIÊU HIẾM','vong-tay-tram-huong-lu-thong-can-chim-sieu-hiem','standard','THÔNG TIN SẢN PHẨM\r\n \r\n\r\nVòng tay được làm từ nguyên liệu Trầm Chìm Rục Cũ của Việt Nam ngày xưa, tông hàng vô cùng hiếm và gần như không còn\r\nSản phẩm có màu nâu vàng ánh đỏ giá trị,  sớ khít già chắc\r\nChất dầu đỏ vô cùng hiếm có, đeo 1 thời gian sẽ ánh đỏ rất đẹp\r\nTông mùi ngọt sữa rất sâu, điểm thêm chút mùi như phomat béo rất ấn tượng\r\nSản phẩm được gia công tỉ mỉ, size hạt lu thống 10li x 12 li\r\nVòng trầm bán ra được tặng kèm hộp đựng sang trọng, kèm phôi vụn và phiếu bảo hành sản phẩm.','<h1><strong>NGUY&Ecirc;N LIỆU TRẦM HƯƠNG TỰ NHI&Ecirc;N GI&Aacute; TRỊ CAO</strong></h1>\r\n<p>Hương V&acirc;n C&aacute;t&nbsp;nhập 100%&nbsp;nguy&ecirc;n liệu&nbsp;<strong>Trầm Hương thi&ecirc;n nhi&ecirc;n</strong>&nbsp;v&agrave; gia c&ocirc;ng trực tiếp tại xưởng, n&ecirc;n sẽ đảm bảo chuẩn nguồn gốc v&agrave; chuẩn chất lượng . Ch&uacute;ng t&ocirc;i chỉ nhập nguy&ecirc;n liệu Trầm Hương c&oacute; chất lượng ph&ocirc;i tốt,&nbsp;hương thơm ngọt đạt chuẩn, kh&ocirc;ng l&agrave;m h&agrave;ng non, h&agrave;ng tận dụng xấu.</p>\r\n<p>V&igrave;&nbsp;t&ocirc;n trọng vẻ đẹp tự nhi&ecirc;n của v&ograve;ng tay trầm, n&ecirc;n c&aacute;c sản phẩm Trầm Hương của&nbsp;ch&uacute;ng t&ocirc;i kh&ocirc;ng c&oacute; xử l&yacute; th&ecirc;m s&aacute;p l&agrave;m sậm hay thủ thuật h&oacute;a chất&nbsp;, n&ecirc;n 100% sản phẩm trầm hương đều an to&agrave;n, chất lượng để mọi người trải nghiệm r&otilde; r&agrave;ng&nbsp;nhất, cảm x&uacute;c nhất trong sự thay đổi&nbsp;của v&acirc;n trầm, sớ gỗ, hương thơm qua&nbsp;mỗi ng&agrave;y.</p>\r\n<p><img style=\"height: auto;\" src=\"https://bizweb.dktcdn.net/100/436/707/files/dau-do-2-1e52d020-d057-4a60-a5cd-16e6bf9b0d63.jpg?v=1648271305333\" alt=\"ph&ocirc;i trầm ch&igrave;m\" data-thumb=\"original\" /></p>',NULL,'sanpham31-64382a79254a4.png','VTCC08',1,135000000.00,0.00,0,0,'public',' 4,',1,0,0,0,1,'2023-04-13 16:14:49','2023-04-13 16:14:49',5),(36,16,4,'BÌNH HOA KIM VŨ LỚN','binh-hoa-kim-vu-lon','standard','Hình ảnh những giọt nắng lấp lánh xuyên qua giàn hoa leo đã truyền cảm hứng để tạo nên bộ sưu tập Kim Vũ. Từng họa tiết nhỏ được kết hợp hài hòa cùng nhau tạo nét tinh tế cho sản phẩm.\r\n\r\nBình hoa sơn mài Kim Vũ dáng trụ tròn gợi nhớ đến những sản phẩm đặc trưng của thương hiệu Hanoia. Sản phẩm được làm mới bằng hiệu ứng lan màu trên nền đỏ nổi bật. Chi tiết chấm màu và chấm nhũ vàng được thực hiện hoàn toàn thủ công, tạo điểm nhấn độc đáo cho sản phẩm.','<p>B&igrave;nh hoa sơn m&agrave;i họa tiết chấm m&agrave;u vẽ tay</p>',NULL,'sanpham13-64382b45a7b87.jpg','A23FN01',1,14500000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:18:13','2023-04-16 08:19:35',6),(37,16,4,'ỐP MACBOOK OOPS','op-macbook-oops','standard','Ốp lưng Oops không chỉ bảo vệ mặt ngoài chiếc Macbook mà còn phản ánh cá tính, gu thẩm mỹ của chủ sở hữu nhờ màu sắc họa tiết tinh tế. Oops có ba sắc thái, bao gồm: Husk - những khối màu khác biệt được xử lý liền mạch, không có vết gợn tạo sự hòa quyện dễ chịu;','<p>Vỏ bao m&aacute;y t&iacute;nh Macbook sơn m&agrave;i ba phi&ecirc;n bản m&agrave;u sắc c&aacute; t&iacute;nh</p>\r\n<p>K&iacute;ch cỡ: Macbook Air<br />Macbook Pro 13</p>',NULL,'sanpham15-64382cffa3ddb.png','A22OM01',1,1650000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:25:35','2023-04-13 16:25:35',6),(38,16,4,'ỐP ĐIỆN THOẠI IPHONE OOPS','op-dien-thoai-iphone-oops','standard','Trong quá trình sử dụng điện thoại không thể tránh khỏi những lúc vô ý va chạm khiến cho mặt lưng bị xước, ốp lưng Oops được làm từ chất liệu mỏng nhẹ, ôm trọn chiếc iPhone 13 sẽ phần nào hạn chế trường hợp rơi vỡ gây hư hỏng. Oops có ba sắc thái,','<p>Ốp điện thoại iPhone 13 sơn m&agrave;i ba phi&ecirc;n bản m&agrave;u c&aacute; t&iacute;nh</p>\r\n<p>K&iacute;ch cỡ: Iphone 13<br />Iphone 13 Pro<br />Iphone 13 Pro Max</p>',NULL,'sanpham16-64382e7d5b2d1.jpg','A22OP01',1,1150000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:31:57','2023-04-16 08:20:08',6),(39,16,4,'BÌNH HOA KIM VŨ NHỎ','binh-hoa-kim-vu-nho','standard','Bình hoa sơn mài Kim Vũ dáng trụ tròn gợi nhớ đến những sản phẩm đặc trưng của thương hiệu Hanoia. Sản phẩm được làm mới bằng hiệu ứng lan màu trên nền vàng dịu ấm ấp. Chi tiết chấm màu và chấm nhũ vàng được thực hiện hoàn toàn thủ công, tạo điểm nhấn độc đáo cho thiết kế.','<p>B&igrave;nh hoa sơn m&agrave;i họa tiết chấm m&agrave;u vẽ tay</p>',NULL,'sanpham17-64382ee697e67.png','A23FN02',1,7950000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:33:42','2023-04-16 08:20:36',6),(40,16,4,'LỌ HOA CHÚ CUỘI','lo-hoa-chu-cuoi','standard','Chú Cuội, cây đa, vầng trăng là những biểu tượng đã xuất hiện từ lâu trong văn hóa Việt. Mượn những hình ảnh quen thuộc ấy, Hanoia cho ra mắt dòng sản phẩm chú Cuội như để gợi nhắc đến những giá trị truyền thống tốt đẹp.\r\n\r\nBình hoa Chú Cuội dáng trụ được thiết kế mới lạ bằng chi tiết miệng bình cắt vát, viền và mặt trong dát lá bạc nhuộm vàng lấp lánh. Thân bình cũng được trang trí bằng họa tiết lá đa dán lá vàng và vẽ tay tỉ mỉ tạo điểm nhấn độc đáo cho sản phẩm.','<p>B&igrave;nh hoa sơn m&agrave;i họa tiết l&aacute; đa vẽ tay tỉ mỉ sau đ&oacute; đắp l&aacute; v&agrave;ng</p>',NULL,'sanpham18-64382f87744d5.png','C22CI01',1,5450000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:36:23','2023-04-16 08:22:00',6),(41,16,4,'VỎ BAO AIRPODS PRO OOPS','vo-bao-airpods-pro-oops','standard','Không chỉ là vật dụng bảo vệ tai nghe, Oops còn là món phụ kiện độc đáo dành cho những người trẻ muốn thể hiện cá tính với hai sắc thái cá tính, bao gồm: Husk với những khối màu khác biệt được xử lý liền mạch, không có vết gợn tạo sự hòa quyện dễ chịu; Tinted Silver Leaf - một hiệu ứng đặc biệt được thực hiện bằng cách dán lá bạc ở nền sau đó nhuộm tinh màu đỏ và xanh dương tạo vẻ ngoài độc đáo đầy sang trọng.','<p>Vỏ bao tai nghe kh&ocirc;ng d&acirc;y AirPords sơn m&agrave;i hai phi&ecirc;n bản m&agrave;u sắc c&aacute; t&iacute;nh</p>',NULL,'sanpham19-64383001089f4.png','A22OA01',1,750000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:38:25','2023-04-16 08:22:42',6),(42,16,4,'BÌNH HOA HOA VŨ','binh-hoa-hoa-vu','standard','Hộp trà xôi giữ nguyên thiết kế truyền thống của Hanoia, nhưng trong mùa năm nay sự thay đổi nằm ở hai gam màu đậm chất Á Đông là xanh lá đậm và đỏ. Họa tiết trên hộp trà Hoa Vũ tái hiện lại một cách chân thực vẻ đẹp dịu dàng của loài hoa được coi là nữ hoàng của thế giới hoa.','<p>B&igrave;nh hoa sơn m&agrave;i, họa tiết hoa lan vẽ tay</p>\r\n<p>K&iacute;ch cỡ: D160x226 (mm), D216x300 (mm)</p>',NULL,'sanpham20-64383084e6b90.png','A23OD02',1,8950000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:40:37','2023-04-13 16:40:37',6),(43,16,4,'HỘP MỨT TRÒN HOA VŨ','hop-mut-tron-hoa-vu','standard','Một hình ảnh không thể thiếu trong những ngày Tết cổ truyền Việt Nam chính là hộp đựng bánh mứt kẹo. Hanoia vẫn gìn giữ truyền thống này bằng sản phẩm hộp tròn Hoa Vũ với thiết kế quen thuộc qua từng năm nhưng được đổi mới bằng họa tiết cánh hoa lan trắng được thể hiện sinh động bằng kỹ thuật vẽ tay điêu luyện. Đi kèm hộp tròn là bảy chiếc bát gốm nhỏ được dùng để đựng những món bánh mứt kẹo cổ truyền.','<p>Hộp mứt tr&ograve;n sơn m&agrave;i, họa tiết hoa lan vẽ tay</p>\r\n<p>K&iacute;ch cỡ: D280mm x 80mm</p>',NULL,'sanpham21-643830eae9925.png','A23OD04',1,6950000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:42:19','2023-04-16 08:23:16',6),(44,16,4,'MÓC TREO TRANG SỨC KỲ HOA','moc-treo-trang-suc-ky-hoa','standard','Không mang vẻ đẹp của những loài hoa thông thường, Kỳ Hoa toát lên sự huyền bí mà sang trọng riêng. Những chiếc gai sắc nhọn qua thiết kế của Hanoia đã trở thành móc cài trang sức bằng đồng, kết hợp với lớp nhung đỏ ở giữa tạo thành sản phẩm mang tính thẩm mỹ cao','<p>M&oacute;c treo trang sức sơn m&agrave;i tạo h&igrave;nh c&acirc;y Venus Flytrap</p>\r\n<p>K&iacute;ch cỡ: D300mm x 98mm</p>',NULL,'sanpham22-6438317298e59.png','A23JA01',1,19500000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:44:34','2023-04-16 08:24:04',6),(45,16,4,'Cây kim tiền hổ phách 23 cm','cay-kim-tien-ho-phach-23-cm','standard','Cây được làm từ chất liệu hổ phách tự nhiên kết hợp cùng thân cây bằng gỗ quý. Với thiết kế đơn giản nhưng vô cùng tinh tế, cây tiền tài lộc đã toát lên lên được nét sang trọng, quyền quý. Đây là một vật phẩm nhiều ý nghĩa để cầu may mắn tài lộc đến với gia chủ.',NULL,NULL,'sanpham32-643832eda070b.png','0059914',1,10000000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:50:53','2023-04-16 08:24:52',7),(46,16,4,'“Malachite” – Set uống trà đá lông công mạ vàng','malachite-set-uong-tra-da-long-cong-ma-vang','standard','Các tác phẩm của các bậc thầy tài năng từ Zlatoust được biết đến trên toàn thế giới. Khắc kim loại Zlatoust đã nổi tiếng không chỉ ở Nga mà còn ở nước ngoài trong nhiều năm.\r\n\r\nVí dụ nổi bật nhất trong những sản phẩm của các bậc thầy Ural nổi tiếng là bộ trà Malachite. Sản phẩm này được thực hiện theo kỹ thuật tốt nhất về khắc Zlatoust. Để tạo ra sản phẩm này, đó là một sự kết hợp nhuần nhuyễn, chuyên nghiệp của nhiều người nghệ nhân khắc – tiện cùng lúc.','<p>Bộ uống tr&agrave; được chế t&aacute;c từ b&agrave;n tay của c&aacute;c nghệ nh&acirc;n Zlatoust sẽ l&agrave; một m&oacute;n qu&agrave; tuyệt vời cho người th&acirc;n, bạn b&egrave; hoặc đồng nghiệp. Bộ uống tr&agrave; của t&aacute;c giả sẽ l&agrave; một điểm nhấn tuyệt vời cho nội thất của chủ sở hữu n&oacute; trong nhiều năm.</p>\r\n<p>Nếu bạn băn khoăn kh&ocirc;ng biết n&ecirc;n chọn m&oacute;n qu&agrave; n&agrave;o cho sếp, đối t&aacute;c, kh&aacute;ch h&agrave;ng,&hellip; th&igrave; đ&acirc;y cũng l&agrave; một gợi &yacute; cực k&igrave; tinh tế m&agrave; bạn c&oacute; thể tham khảo. Đến ngay&nbsp;<strong>LUXURY GIFTS</strong>&nbsp;để chọn được m&oacute;n qu&agrave; tặng VIP chất lượng ho&agrave;n hảo nhất.</p>\r\n<p>LUXURY GIFTS &ndash;&nbsp;địa chỉ uy t&iacute;n số 1 thị trường về qu&agrave; tặng cao cấp. Ch&uacute;ng t&ocirc;i lu&ocirc;n tự h&agrave;o mang tới những gi&aacute; trị thật cho kh&aacute;ch h&agrave;ng, kh&ocirc;ng gian lựa chọn qu&agrave; kỷ niệm, t&aacute;c phẩm nghệ thuật tuyệt t&aacute;c cho bạn.</p>',NULL,'sanpham33-6438338e77a14.png','ZL0015187',1,70800000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:53:34','2023-04-16 08:25:22',7),(47,16,4,'Lorem ipsum','lorem-ipsum','standard',NULL,NULL,NULL,'sanpham34-643833ff1fe27.png','Lorem 1',1,9999.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:55:27','2023-04-13 16:55:27',7),(48,16,4,'Cây kim tiền hổ phách','cay-kim-tien-ho-phach','standard','Cây được làm từ chất liệu hổ phách tự nhiên kết hợp cùng thân cây bằng gỗ quý. Với thiết kế đơn giản nhưng vô cùng tinh tế, cây tiền tài lộc đã toát lên lên được nét sang trọng, quyền quý. Đây là một vật phẩm nhiều ý nghĩa để cầu may mắn tài lộc đến với gia chủ.','<p><strong>Amber money tree</strong></p>\r\n<p>Materials: amber, wood.</p>\r\n<p>Height: 32 cm</p>',NULL,'sanpham35-64383459e794a.png','0055700',1,15600000.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:56:58','2023-04-16 08:25:50',7),(49,16,4,'Lorem ipsum 1','lorem-ipsum-1','standard',NULL,NULL,NULL,'sanpham36-643835029118b.png','Lorem 2',1,9999.00,0.00,0,0,'public',' 4,',1,0,0,0,0,'2023-04-13 16:59:46','2023-04-16 08:26:15',7),(50,16,4,'Bộ 6 ly uống rượu cao cấp mạ vàng ” Alhambra “','bo-6-ly-uong-ruou-cao-cap-ma-vang-alhambra','standard','Một bộ ly rượu đ