ghế','ban-an-4-ghe','standard','Bàn ăn vuông 4 ghế (ộc bản)\r\nKích thước bàn: D800xR1600xC750\r\nKích thước ghế: D660xR500xC955',NULL,NULL,'049632900-1682951799.png','ba4g',1,0.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 14:28:31','2023-05-01 14:37:59',8),(114,17,5,'Ghế sofa căn hộ bằng da','ghe-sofa-can-ho-bang-da','standard',NULL,'<p>Thỏa sức tận hưởng kh&ocirc;ng gian ngồi nghỉ tr&ecirc;n chiếc ghế sofa Wells của ch&uacute;ng t&ocirc;i, được bọc bởi da sang trọng. Đ&acirc;y l&agrave; phi&ecirc;n bản cập nhật của chiếc ghế sofa da cổ điển, k&iacute;ch thước nhỏ hơn để ph&ugrave; hợp với căn hộ. Với những đệm &ecirc;m &aacute;i đặt tr&ecirc;n khung sườn thanh mảnh được hỗ trợ bởi ch&acirc;n sắt, chiếc ghế n&agrave;y tr&ocirc;ng cổ điển v&agrave; hiện đại. Tạo sự tinh tế với c&aacute;c đường may v&agrave; v&acirc;n da tự nhi&ecirc;n, chiếc ghế sử dụng da thật top-grain với bề mặt đẹp v&agrave; c&oacute; lớp b&oacute;ng độc đ&aacute;o, được tạo ra khi những dầu v&agrave; s&aacute;p được sử dụng trong qu&aacute; tr&igrave;nh ho&agrave;n thiện được k&eacute;o gi&atilde;n để tạo ra những sắc th&aacute;i nhẹ hơn được gọi l&agrave; \"burst\". Mỗi chiếc sofa l&agrave; một sản phẩm độc đ&aacute;o của Crate and Barrel với c&aacute;c đặc điểm tự nhi&ecirc;n kh&aacute;c nhau.</p>\r\n<p>Sản phẩm n&agrave;y được chứng nhận bởi Tổ chức Quản l&yacute; Rừng (FSC&reg;), một tổ chức quốc tế tuyển dụng c&aacute;c b&ecirc;n thứ ba độc lập để chứng nhận c&aacute;c rừng được quản l&yacute; c&oacute; tr&aacute;ch nhiệm v&agrave; đem lại lợi &iacute;ch về mặt x&atilde; hội, kinh tế v&agrave; m&ocirc;i trường.</p>\r\n<p>K&iacute;ch thước của Wells Leather Apartment Sofa l&agrave; 72 \"Wx35.5\" Dx31 \"H, được l&agrave;m từ gỗ kỹ thuật v&agrave; v&aacute;n d&aacute;n c&oacute; chứng nhận FSC&reg; v&agrave; được sấy kh&ocirc; để ngăn chặn co ng&oacute;t. Ghế c&oacute; đệm ngồi được l&agrave;m từ bọt cao su chống n&eacute;n v&agrave; sợi l&ocirc;ng vũ được bọc trong lớp vải chống thấm l&ocirc;ng vũ. Đệm lưng l&agrave; sợi polyester. C&oacute; 2 gối tr&ograve;n được đổ bằng chất liệu polyfiber. Khung ghế sử dụng hệ thống treo l&ograve; xo đ&agrave;n hồi. Ch&acirc;n ghế được sơn mờ đen với đường may v&agrave; c&aacute;c chi tiết đường may trang tr&iacute; tinh tế.</p>\r\n<p>Để giữ cho bề mặt da được giữ nguy&ecirc;n t&igrave;nh trạng tốt nhất, tr&aacute;nh tiếp x&uacute;c trực tiếp với &aacute;nh nắng mặt trời. Sản phẩm được nhập khẩu v&agrave; chi tiết về nội dung sản phẩm c&oacute; thể được xem tr&ecirc;n nh&atilde;n sản phẩm hoặc th&ocirc;ng qua dịch vụ kh&aacute;ch h&agrave;ng.</p>',NULL,'thumb01-644ff9f1c84a1.jpg','wellssofa',1,70371535.00,0.00,0,0,'public',' 5,',1,1,0,0,1,'2023-05-01 17:42:09','2023-05-03 06:11:46',13),(115,17,5,'Sofa Mây','sofa-may','standard',NULL,'<p>Bộ ghế sofa ngo&agrave;i trời Abaco của ch&uacute;ng t&ocirc;i c&oacute; thiết kế thấp v&agrave; sẵn s&agrave;ng để thư gi&atilde;n. Được dệt thủ c&ocirc;ng với một loại vải d&agrave;y, c&oacute; độ d&agrave;y vừa phải, kh&aacute; độc đ&aacute;o, chống thời tiết, chiếc sofa n&agrave;y mang lại nhiều m&agrave;u sắc từ x&aacute;m đến n&acirc;u để t&aacute;i tạo m&agrave;u sắc tinh tế của một chiếc rattan cũ. Khung nh&ocirc;m hiện đại v&agrave; đậm chất tạo cho người ngồi cảm gi&aacute;c thoải m&aacute;i với ghế s&acirc;u v&agrave; tay vịn rộng ph&ugrave; hợp để uống thức uống m&aacute;t.</p>\r\n<p>Một chiếc đệm được phủ bằng chất liệu Sunbrella acrylic chống phai m&agrave;u, chống ố v&agrave;ng, chống nước v&agrave; chống nấm mốc mang đến một lớp &ecirc;m &aacute;i bổ sung. Bộ ghế sofa ngo&agrave;i trời Abaco với đệm Sunbrella&reg; Graphite l&agrave; độc quyền của Crate and Barrel.</p>',NULL,'sofamay1-645002a98fa38.jpg','sofamay',1,44090735.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:19:21','2023-05-02 13:34:11',8),(116,17,5,'Ghế Dài Ngoài Trời','ghe-dai-ngoai-troi','standard',NULL,'<p>Ghế chaise lounge ngo&agrave;i trời Abaco của ch&uacute;ng t&ocirc;i c&oacute; thiết kế thấp v&agrave; sẵn s&agrave;ng để thư gi&atilde;n. Được dệt thủ c&ocirc;ng với một loại vải d&agrave;y, c&oacute; độ d&agrave;y vừa phải, kh&aacute; độc đ&aacute;o, chống thời tiết, chiếc ghế n&agrave;y mang lại nhiều m&agrave;u sắc từ x&aacute;m đến n&acirc;u để t&aacute;i tạo m&agrave;u sắc tinh tế của một chiếc rattan cũ. G&oacute;c nghi&ecirc;ng của tựa lưng c&oacute; thể điều chỉnh cho ph&ugrave; hợp với từng nhu cầu thư gi&atilde;n kh&aacute;c nhau.</p>\r\n<p>Chiếc đệm được phủ bằng chất liệu Sunbrella acrylic chống phai m&agrave;u, chống ố v&agrave;ng, chống nước v&agrave; chống nấm mốc được thiết kế gọn g&agrave;ng để mang lại sự thoải m&aacute;i tối đa cho người d&ugrave;ng. Ghế chaise lounge ngo&agrave;i trời Abaco với đệm Sunbrella&reg; Graphite l&agrave; độc quyền của Crate and Barrel.</p>\r\n<p>Th&ocirc;ng số kỹ thuật:</p>\r\n<ul style=\"list-style-type: disc;\">\r\n<li>Ghế chaise lounge ngo&agrave;i trời Abaco với đệm Sunbrella&reg; Graphite c&oacute; k&iacute;ch thước 80\"Wx29\"Dx11\"H</li>\r\n<li>Dệt thủ c&ocirc;ng</li>\r\n<li>Chống thời tiết với vật liệu nhựa dẻo</li>\r\n<li>Khung nh&ocirc;m với lớp phủ bột sơn chống ăn m&ograve;n</li>\r\n<li>Đệm chống phai m&agrave;u v&agrave; nấm mốc Sunbrella acrylic, được đổ bọt v&agrave; c&oacute; kh&oacute;a th&ocirc;ng gi&oacute;</li>\r\n<li>G&oacute;c nghi&ecirc;ng tựa lưng c&oacute; thể điều chỉnh</li>\r\n<li>Ch&acirc;n nhựa dẻo để di chuyển dễ d&agrave;ng</li>\r\n</ul>',NULL,'ghengoaitroi2-645004d2e187d.jpg','ghengoaitroi',1,38693785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:28:35','2023-05-03 06:06:49',8),(117,17,5,'Ghế Lounge Ngoài Trời','ghe-lounge-ngoai-troi','standard',NULL,'<p>Thấp v&agrave; sẵn s&agrave;ng cho việc thư gi&atilde;n, chiếc ghế d&agrave;i ngo&agrave;i trời Abaco của ch&uacute;ng t&ocirc;i mời gọi bạn thư gi&atilde;n v&agrave; thả lỏng. Được dệt thủ c&ocirc;ng với một kiểu dệt d&agrave;y, với một cấu tr&uacute;c văn ho&aacute; mang lại nhiều m&agrave;u x&aacute;m n&acirc;u để t&aacute;i tạo lại sắc tố tinh tế của nứa r&aacute;ch cũ. Khung hợp kim nh&ocirc;m hiện đại v&agrave; mạnh mẽ cung cấp một chỗ ngồi s&acirc;u v&agrave; tay vịn rộng r&atilde;i ho&agrave;n hảo để thưởng thức một ly đồ uống m&aacute;t. Một c&aacute;i đệm phủ bằng Sunbrella acrylic chống phai m&agrave;u, chống bẩn, chống nước v&agrave; chống nấm mốc bổ sung một lớp &ecirc;m &aacute;i. Ghế d&agrave;i ngo&agrave;i trời Abaco với đệm Graphite Sunbrella &reg; l&agrave; độc quyền của Crate and Barrel.</p>\r\n<p>Để giữ cho sản phẩm n&agrave;y lu&ocirc;n đẹp nhất, ch&uacute;ng t&ocirc;i khuyến kh&iacute;ch bảo vệ n&oacute; khỏi thời tiết xấu bằng Bộ phủ ghế d&agrave;i ngo&agrave;i trời lớn WeatherMAX của KoverRoos.</p>\r\n<p>Ghế d&agrave;i ngo&agrave;i trời Abaco với đệm Graphite Sunbrella &reg;: 44 \"Wx36.25\" Dx31.75 \"H Được dệt thủ c&ocirc;ng Khung dệt bằng nhựa chống thời tiết Khung hợp kim nh&ocirc;m với lớp sơn tĩnh điện Sunbrella acrylic chống phai v&agrave; chống nấm mốc với lớp đệm bọt v&agrave; kh&oacute;a th&ocirc;ng gi&oacute;.</p>',NULL,'gheloungh-64500794e4f34.jpg','gheloungengoaitroi',1,2602268.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:40:21','2023-05-03 06:09:22',8),(118,17,5,'Ghế Sofa Đôi Ngoài Trời','ghe-sofa-doi-ngoai-troi','standard',NULL,'<p>Bộ sưu tập Dune phong c&aacute;ch đ&ocirc; thị của ch&uacute;ng t&ocirc;i thực sự l&agrave; một \"ph&ograve;ng kh&aacute;ch trong nh&agrave;\" hiện đại sống ngo&agrave;i trời. Ghế d&agrave;i/sofa độc đ&aacute;o của ch&uacute;ng t&ocirc;i c&oacute; thể điều chỉnh linh hoạt cho mọi t&igrave;nh huống. Mỗi chỗ ngồi chaise d&agrave;i rộng c&oacute; thể điều chỉnh được độ nghi&ecirc;ng để thoải m&aacute;i nằm b&ecirc;n cạnh hoặc đối diện nhau, tận hưởng &aacute;nh nắng v&agrave; tắm nắng. Khi mặt trời lặn, n&oacute; c&oacute; thể chuyển th&agrave;nh một chiếc ghế sofa để thư gi&atilde;n hoặc tr&ograve; chuyện sau giờ l&agrave;m việc.</p>\r\n<p>Khung bằng th&eacute;p kh&ocirc;ng gỉ chất lượng ngo&agrave;i trời với việc ho&agrave;n thiện tay mượt m&agrave; được bọc bằng lưới tổng hợp chống tia UV, phai m&agrave;u, mốc, r&aacute;ch v&agrave; bẩn. Ghế d&agrave;i/sofa hai chỗ ngồi ngo&agrave;i trời bao gồm c&aacute;c đệm ngồi thoải m&aacute;i được bọc bằng Sunbrella acrylic chống thời tiết. Dune Taupe Double Chaise Sofa Lounge với đệm Sunbrella &reg; l&agrave; sản phẩm độc quyền của Crate and Barrel.</p>\r\n<p>Dune Taupe Double Chaise Sofa Lounge với đệm Sunbrella &reg; 47,25\"Wx78,75\"Dx37,75\"H Được l&agrave;m thủ c&ocirc;ng Khung bằng th&eacute;p kh&ocirc;ng gỉ chất lượng ngo&agrave;i trời được bọc bằng lưới tổng hợp C&aacute;c đệm ngồi chống phai v&agrave; chống nấm mốc Sunbrella acrylic Điền đệm bằng bọt xốp C&oacute; thể điều chỉnh đến ba vị tr&iacute; Được nhập khẩu</p>',NULL,'ghesofadoi-645008d54d332.jpg','ghesofadoi',1,53946035.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:45:41','2023-05-03 06:09:58',8),(119,17,5,'Sofa 6 Mảnh Ngoài Trời','sofa-6-manh-ngoai-troi','standard',NULL,'<p>Tạo ra sự thư gi&atilde;n tối đa với bộ sưu tập Dune sectional của ch&uacute;ng t&ocirc;i, mang đến phong c&aacute;ch th&agrave;nh thị hiện đại \"đồ nội thất trong nh&agrave;\" cho cuộc sống ngo&agrave;i trời. Vải lưới tổng hợp chịu thời tiết che phủ khung th&eacute;p kh&ocirc;ng gỉ b&ecirc;n ngo&agrave;i được thủ c&ocirc;ng bằng th&eacute;p kh&ocirc;ng gỉ bền vững cho ngo&agrave;i trời. Bộ ghế d&agrave;i ngo&agrave;i trời gồm ghế t&igrave;nh v&ograve;ng tay b&ecirc;n tr&aacute;i, ghế t&igrave;nh v&ograve;ng tay b&ecirc;n phải, hai ghế kh&ocirc;ng tay v&agrave; hai g&oacute;c được trang bị đệm che phủ bằng Sunbrella chịu thời tiết. Bộ ghế d&agrave;i 6 m&oacute;n Dune Taupe với đệm che phủ Sunbrella&reg; l&agrave; độc quyền của Crate and Barrel.</p>\r\n<p>Ghế t&igrave;nh v&ograve;ng tay b&ecirc;n tr&aacute;i, 2 g&oacute;c, 2 ghế kh&ocirc;ng tay, ghế t&igrave;nh v&ograve;ng tay b&ecirc;n phải 128 \"Wx98\" Dx31.25 \"H Được thủ c&ocirc;ng Khung th&eacute;p kh&ocirc;ng gỉ cho ngo&agrave;i trời được che phủ bởi vải lưới tổng hợp chịu thời tiết Đệm che phủ bằng Sunbrella chịu thời tiết v&agrave; chống nấm mốc Đệm đựng bằng bọt polyester Phụ kiện kết nối sectional bao gồm Bao gồm ghế t&igrave;nh v&ograve;ng tay b&ecirc;n tr&aacute;i, ghế t&igrave;nh v&ograve;ng tay b&ecirc;n phải, hai ghế kh&ocirc;ng tay v&agrave; hai g&oacute;c Được nhập khẩu</p>',NULL,'ghe6manh1-64500a90c5354.jpg','sofa6manh',1,12539696.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:53:04','2023-05-03 06:10:26',8),(120,17,5,'Ghế Accent','ghe-accent','standard',NULL,'<p>Ghế đan giống như những chiếc ghế đan giữa thế kỷ đang c&oacute; khoảnh khắc hiện đại trong Taj. Dải rộng của da full-aniline quấn qua v&agrave; xung quanh khung gỗ c&acirc;y xoa tự nhi&ecirc;n để tạo ra một chiếc ghế vừa hỗ trợ vừa đẹp mắt. Ch&uacute;ng t&ocirc;i y&ecirc;u c&aacute;ch m&agrave; chiếc ghế thu h&uacute;t sự ch&uacute; &yacute; đến sự kh&eacute;o l&eacute;o trong thủ c&ocirc;ng, được thể hiện trong c&aacute;c chốt kh&oacute;a c&oacute; thể nh&igrave;n thấy gắn da v&agrave;o khung. Ghế Taj Leather Strap l&agrave; độc quyền của Crate and Barrel.</p>\r\n<p>Taj Brown Woven Leather Strap Chair 24\"Wx29.5\"Dx32.5\"H Thiết kế bởi Winardi Thamrin Khung được l&agrave;m từ gỗ acacia được trồng trọt đứng vững Y&ecirc;n v&agrave; tựa lưng được đan từ những dải da full-aniline nhuộm m&agrave;u Chi tiết đinh t&aacute;n tr&ecirc;n tựa lưng Được sản xuất tại Ấn Độ Xem nh&atilde;n sản phẩm hoặc gọi cho dịch vụ kh&aacute;ch h&agrave;ng để biết th&ecirc;m chi tiết về nội dung sản phẩm.</p>',NULL,'gheaccent1-64500be20c322.jpg','gheaccent',1,23441535.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 18:58:42','2023-05-03 06:11:07',8),(121,17,5,'Gương Đứng Cạnh Gỗ Sồi','guong-dung-canh-go-soi','standard',NULL,'<p>Với viền sồi mỏng bao quanh, gương đứng tối giản n&agrave;y mang lại sự thanh lịch hiện đại trong h&igrave;nh dạng h&igrave;nh chữ nhật cong. Gương đứng tự do, độc quyền của Crate and Barrel, nghi&ecirc;ng tr&ecirc;n một ch&acirc;n đỡ m&agrave; tương tự với khung gương của n&oacute;. Với viền gỗ m&agrave;u mật ong của n&oacute;, gương đứng mảnh mai l&agrave; một m&oacute;n đồ cần thiết tinh tế. Nh&oacute;m c&ugrave;ng với c&aacute;c gương tr&ograve;n, h&igrave;nh n&ograve;ng, v&agrave; h&igrave;nh chữ nhật cong Edge của ch&uacute;ng t&ocirc;i trong đồng, bạc, đen v&agrave; gỗ &oacute;c ch&oacute; để tạo ra một hiển thị h&igrave;nh học hấp dẫn.</p>\r\n<p>Gương đứng Edge Oak. 18.03 \"Wx2.44\" Dx64.05 \"H Sồi, k&iacute;nh gương v&agrave; gỗ kỹ thuật Nghi&ecirc;ng tr&ecirc;n ch&acirc;n đỡ Gương đứng kh&ocirc;ng d&agrave;nh cho việc treo tr&ecirc;n tường Được sản xuất tại Việt Nam</p>',NULL,'guongsoi1-64500d4669c1c.jpg','guongdungcanhgosoi',1,9362535.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:04:38','2023-05-03 06:12:11',8),(122,17,5,'Gương sàn vòm bạc cạnh','guong-san-vom-bac-canh','standard',NULL,'<p>Với viền mỏng bằng bạc, chiếc gương đứng tối giản n&agrave;y c&oacute; d&aacute;ng cong tinh tế hiện đại. K&iacute;nh gương được m&agrave;i b&oacute;ng v&agrave; được bao quanh bởi th&eacute;p kh&ocirc;ng gỉ mỏng với lớp ho&agrave;n thiện mềm mại bạc. Chiếc gương n&agrave;y đứng tr&ecirc;n tường theo chiều dọc v&agrave; an to&agrave;n để sử dụng trong ph&ograve;ng tắm.</p>\r\n<p>Gương đứng Edge Silver Arch. 32 \"Wx1\" Dx76 \"H Th&eacute;p kh&ocirc;ng gỉ với lớp ho&agrave;n thiện bạc K&iacute;nh gương được m&agrave;i b&oacute;ng Th&iacute;ch hợp sử dụng trong ph&ograve;ng tắm Đứng tr&ecirc;n tường Bao gồm phụ kiện chống lật Được nhập khẩu</p>',NULL,'guongsan1-64500e8571677.jpg','guongsanvomcanhbac',1,14055535.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:09:57','2023-05-03 06:12:49',8),(123,17,5,'Gương hình chữ nhật','guong-hinh-chu-nhat','standard',NULL,'<p>Với đường viền đồng mảnh, gương tường đơn giản n&agrave;y cong th&agrave;nh h&igrave;nh chữ nhật với h&igrave;nh d&aacute;ng hiện đại v&agrave; thanh lịch. K&iacute;nh gương m&agrave;i cạnh được bao bọc bởi th&eacute;p kh&ocirc;ng gỉ mảnh với lớp phủ đồng b&oacute;ng lo&aacute;ng. Gương n&agrave;y c&oacute; thể treo tr&ecirc;n tường theo chiều dọc hoặc ngang v&agrave; an to&agrave;n để treo trong ph&ograve;ng tắm.</p>\r\n<p>Gương tường h&igrave;nh chữ nhật đồng Edge 36\"Wx1\"Dx24\"H Th&eacute;p kh&ocirc;ng gỉ với lớp phủ đồng K&iacute;nh gương m&agrave;i cạnh Th&iacute;ch hợp để treo trong ph&ograve;ng tắm Treos bằng kh&oacute;a D được cung cấp; kh&ocirc;ng n&ecirc;n treo bằng d&acirc;y treo Được nhập khẩu</p>',NULL,'hcn1-64500f9b11829.jpg','guonghcn',1,5842785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:14:35','2023-05-03 06:13:15',8),(124,17,5,'Gương tròn','guong-tron','standard',NULL,'<p>L&agrave;m viền với một dải đen mảnh, gương tường tr&ograve;n đơn giản n&agrave;y c&oacute; h&igrave;nh dạng tr&ograve;n hiện đại v&agrave; thanh lịch. Với khung bằng th&eacute;p kh&ocirc;ng gỉ ho&agrave;n thiện đen, gương tường tr&ograve;n l&agrave; một sản phẩm thiết yếu v&agrave; trang nh&atilde; trong bất kỳ căn ph&ograve;ng n&agrave;o v&agrave; an to&agrave;n để treo trong ph&ograve;ng tắm. Kết hợp với c&aacute;c gương tường v&agrave; s&agrave;n kh&aacute;c trong bộ sưu tập Edge của ch&uacute;ng t&ocirc;i bao gồm c&aacute;c mẫu h&igrave;nh v&ograve;m, h&igrave;nh chữ nhật bo tr&ograve;n v&agrave; h&igrave;nh đ&oacute;ng khối với m&agrave;u bạc, đồng v&agrave; đen để tạo n&ecirc;n một bức tường gương h&igrave;nh học hấp dẫn.</p>\r\n<p>Gương tường tr&ograve;n đen Edge 48\". Đường k&iacute;nh 48\", độ d&agrave;y 1\" Th&eacute;p kh&ocirc;ng gỉ với ho&agrave;n thiện đen K&iacute;nh gương bị m&agrave;i v&aacute;t Ph&ugrave; hợp để sử dụng trong ph&ograve;ng tắm Trèo bằng D-rings được cung cấp; kh&ocirc;ng treo bằng d&acirc;y Nhập khẩu.</p>',NULL,'tron1-645010574ec25.jpg','guongtron',1,11709035.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:17:43','2023-05-03 06:13:41',8),(125,17,5,'Gương vòm','guong-vom','standard',NULL,'<p>Với viền đồng mảnh, gương tường cong tối giản n&agrave;y tạo n&ecirc;n một d&aacute;ng vẻ hiện đại v&agrave; tinh tế. Với k&iacute;ch thước vừa phải, gương tường cong n&agrave;y được l&agrave;m bằng th&eacute;p kh&ocirc;ng gỉ với lớp ho&agrave;n thiện đồng, v&agrave; được trang bị k&iacute;nh phản chiếu. Gương tường n&agrave;y ph&ugrave; hợp với bất kỳ ph&ograve;ng n&agrave;o trong nh&agrave; v&agrave; an to&agrave;n khi treo trong ph&ograve;ng tắm. Bạn c&oacute; thể phối gh&eacute;p gương tường cong n&agrave;y với c&aacute;c loại gương tường v&agrave; gương đứng kh&aacute;c trong bộ sưu tập Edge của ch&uacute;ng t&ocirc;i, bao gồm m&agrave;u niken b&oacute;ng, đồng v&agrave; m&agrave;u sắc s&uacute;ng để tạo ra một bức tranh h&igrave;nh học th&uacute; vị.</p>\r\n<p>Gương tường cong Edge Brass Arch. 36 \"Wx1\" Dx34 \"H Th&eacute;p kh&ocirc;ng gỉ với ho&agrave;n thiện đồng K&iacute;nh phản chiếu được trang tr&iacute; bằng viền Ph&ugrave; hợp cho ph&ograve;ng tắm Treo bằng v&ograve;ng D được cung cấp; kh&ocirc;ng treo bằng d&acirc;y Nhập khẩu</p>',NULL,'vom1-645011c0b1dde.jpg','guongvom',1,8189285.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:23:44','2023-05-03 06:14:05',8),(126,17,5,'Gương cạnh đồng thau','guong-canh-dong-thau','standard',NULL,'<p>Viền kết th&uacute;c bằng một dải đồng mỏng, gương tường hiện đại n&agrave;y uốn cong th&agrave;nh h&igrave;nh d&aacute;ng tr&aacute;i &oacute;val d&agrave;i v&agrave; thanh lịch. K&iacute;nh gương c&oacute; lược sọc được bao quanh bởi th&eacute;p kh&ocirc;ng gỉ mỏng với một lớp ho&agrave;n thiện đồng ấm &aacute;p. Gương n&agrave;y c&oacute; thể được treo tr&ecirc;n tường theo chiều ngang hoặc dọc v&agrave; an to&agrave;n để treo trong ph&ograve;ng tắm. L&agrave; một phần của bộ sưu tập Edge độc quyền của ch&uacute;ng t&ocirc;i, bao gồm c&aacute;c gương tường v&agrave; s&agrave;n tr&ograve;n, chữ nhật v&agrave; h&igrave;nh cung kim loại hiện đại.</p>\r\n<p>Edge Brass Capsule Mirror 16 \"Wx1\" Dx48 \"H Th&eacute;p kh&ocirc;ng gỉ với ho&agrave;n thiện đồng K&iacute;nh gương c&oacute; lược sọc Ph&ugrave; hợp cho ph&ograve;ng tắm Treos l&ecirc;n tường theo chiều dọc hoặc ngang Treos với D-rings được cung cấp; kh&ocirc;ng treo với d&acirc;y Nhập khẩu</p>',NULL,'a1-6450131f21f39.jpg','guongcanhdongthau',1,7016035.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:29:35','2023-05-03 06:14:29',8),(127,17,5,'Tranh 25x25','tranh-25x25','standard',NULL,'<p>Lấy cảm hứng từ nghệ thuật in hiện đại, bộ đ&ocirc;i tranh n&agrave;y tạo lớp m&agrave;u sắc giả tương tự như mực được lăn tr&ecirc;n khối v&agrave; m&agrave;n h&igrave;nh. Bản in tr&ecirc;n vải của ch&uacute;ng t&ocirc;i ghi lại những sắc xanh, x&aacute;m v&agrave; n&acirc;u nhạt trong suốt của bức tranh gốc, được tăng cường bằng c&aacute;c hoạ tiết cọ vẽ thủ c&ocirc;ng để tạo ra vẻ đẹp của sắc th&aacute;i m&agrave;u sắc được t&iacute;ch lũy. Treo cặp tranh vu&ocirc;ng n&agrave;y c&ugrave;ng nhau hoặc t&aacute;ch ri&ecirc;ng, theo chiều ngang hoặc dọc - t&ugrave;y theo kh&ocirc;ng gian của bạn. Bộ tranh \"Tonal Layers\" được tr&igrave;nh b&agrave;y trong khung gỗ nổi với ho&agrave;n thiện m&agrave;u x&aacute;m driftwood.</p>\r\n<p>\"Tonal Layers\" Tranh in nghệ thuật trang tr&iacute; tường được khung 25\"x25\" 25\" sq. x 1.88\"D Được in tr&ecirc;n vải canvas C&aacute;c hoạ tiết cọ vẽ thủ c&ocirc;ng Khung gỗ nổi với ho&agrave;n thiện m&agrave;u x&aacute;m driftwood Được đ&oacute;ng khung bằng tay Treo ngang hoặc dọc Cơ chế treo D-ring Lau ch&ugrave;i bằng khăn mềm, kh&ocirc;.</p>',NULL,'tranh251-645014033b3ed.jpg','tranh25x25',1,19921785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:33:23','2023-05-03 06:14:55',8),(128,17,5,'Tranh 42x30','tranh-42x30','standard',NULL,'<p>Những cọ vẽ v&agrave; những đốm s&aacute;ng tạo tạo n&ecirc;n bức tranh biển gợi cảm n&agrave;y. Những n&eacute;t vẽ m&agrave;u c&aacute;t v&agrave; những đốm nhuộm t&ocirc; bờ biển với ba người đi dạo v&agrave; những v&aacute;ch đ&aacute;. In phun tr&ecirc;n nền vải canvas nguy&ecirc;n chất, Shore Tides khoe khả năng thẩm mỹ tự nhi&ecirc;n của sợi vải, trong khi những bức tranh được t&ocirc; th&ecirc;m bằng tay tạo ra vẻ đẹp ch&acirc;n thực như một t&aacute;c phẩm nghệ thuật gốc. Bản sao của ch&uacute;ng t&ocirc;i được tr&igrave;nh b&agrave;y trong khung gỗ treo lơ lửng với một lớp sơn m&agrave;u tự nhi&ecirc;n.</p>\r\n<p>\"B&atilde;i biển trong nước triều\" Bản in trang tr&iacute; tường được đ&oacute;ng khung với c&aacute;c điểm nhấn sơn cấu tr&uacute;c 42\"x30\" 42 \"Wx2.25\"Dx30\"H Được trang tr&iacute; v&agrave; đ&oacute;ng khung bằng tay In tr&ecirc;n vải canvas nguy&ecirc;n chất với c&aacute;c điểm nhấn sơn cấu tr&uacute;c Khung treo bằng gỗ với sơn m&agrave;u tự nhi&ecirc;n Treos ngang Cơ chế treo với m&oacute;c D-ring Lau ch&ugrave;i bằng khăn mềm, kh&ocirc;.</p>',NULL,'401-645014c1e042a.jpg','tranh40x30',1,15228785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:36:34','2023-05-03 06:15:14',8),(129,17,5,'Tranh 30x40','tranh-30x40','standard',NULL,'<p>Nghệ sĩ Beverly Fuller tạo n&ecirc;n một bức tranh trừu tượng với những h&igrave;nh chữ nhật được vẽ rộng r&atilde;i, mang đến h&igrave;nh ảnh như l&aacute;t đ&aacute; l&oacute;t t&agrave;u điện ngầm, tế b&agrave;o thực vật hay vết lốp xe tr&ecirc;n tuyết. Với sự ho&agrave;n to&agrave;n vẽ bằng tay bằng m&agrave;u acrylic tr&ecirc;n nền vải lanh, t&aacute;c phẩm nghệ thuật tạo n&ecirc;n một mặt trận trang tr&iacute; tường mang đến sự y&ecirc;n b&igrave;nh v&agrave; gợi cảm hứng để kh&aacute;m ph&aacute; th&ecirc;m. Được lồng gh&eacute;p trong khung gỗ ấm &aacute;p ph&ugrave; hợp với bức tranh trắng, Countour l&agrave; sản phẩm độc quyền của Crate and Barrel. Do t&iacute;nh chất thủ c&ocirc;ng, mỗi sản phẩm l&agrave; duy nhất.</p>\r\n<p>\"Bức tranh tường Countour\" bằng acrylic vẽ tay tr&ecirc;n nền vải lanh với khung gỗ 30\"x40\" của Beverly Fuller 30\"Wx2\"Dx40\"H Nghệ sĩ: Beverly Fuller Vẽ tay Acrylic tr&ecirc;n vải lanh Khung gỗ với m&agrave;u sắc tự nhi&ecirc;n Trên tượng hoặc ngang Cơ chế treo D-ring Lau ch&ugrave;i bằng khăn mềm, kh&ocirc;.</p>',NULL,'301-645015c40582a.jpg','tranh30x40',1,17575285.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-01 19:40:52','2023-05-03 06:15:44',8),(130,17,5,'Bàn Ăn Ngoài Trời','ban-an-ngoai-troi','standard',NULL,'<p>Dorado mang lại phong c&aacute;ch cao v&agrave; kết hợp vật liệu đa dạng cho c&aacute;c ban c&ocirc;ng, s&acirc;n thượng nhỏ hoặc c&aacute;c khu vực s&acirc;n ngo&agrave;i trời nhỏ kh&aacute;c. Sợi d&acirc;y tổng hợp m&agrave;u đen tạo ra c&aacute;c g&oacute;c v&agrave; cấu tr&uacute;c động đội tr&ecirc;n khung th&eacute;p đen đơn giản của b&agrave;n ăn. Sợi d&acirc;y m&agrave;u đen chống phai v&agrave; chống tia UV bọc quanh phần tr&ecirc;n dạng X của khung để tạo th&agrave;nh một đan d&acirc;y nghi&ecirc;ng, trong khi c&aacute;c sợi d&acirc;y ri&ecirc;ng lẻ xuống ch&eacute;o để tạo ra c&aacute;c ch&acirc;n với những c&aacute;nh phơi th&ocirc;ng gi&oacute;. Một tấm k&iacute;nh vu&ocirc;ng cung cấp bề mặt trong suốt để ngắm nh&igrave;n c&aacute;c sợi d&acirc;y ph&iacute;a dưới. L&agrave; sản phẩm độc quyền của Crate and Barrel, b&agrave;n ăn n&agrave;y đi k&egrave;m với ghế ăn Dorado đen hoặc xanh dương để tạo th&agrave;nh một bộ sưu tập ngo&agrave;i trời th&ocirc;ng minh.</p>\r\n<p>B&agrave;n ăn ngo&agrave;i trời Dorado Black Small Space c&oacute; k&iacute;ch thước 36,97 \"Wx36,97\" Dx28,94 \"H Khung th&eacute;p với lớp sơn tĩnh điện m&agrave;u đen Sợi d&acirc;y tổng hợp chống phai m&agrave;u đen chống tia UV Mặt k&iacute;nh Chỗ ngồi cho 4 người Che hoặc lưu trữ b&ecirc;n trong trong thời tiết xấu Được nhập khẩu</p>',NULL,'b1-64514ee2c5e20.jpg','bananngoaitroi',1,5842785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-02 17:56:50','2023-05-03 06:16:23',8),(131,17,5,'Tranh 40x19','tranh-40x19','standard',NULL,'<p>Những n&eacute;t sơn trắng theo chiều dọc tạo ra một thiết kế lưới giỏ tinh tế tr&ecirc;n bề mặt vải canvas th&ocirc;. T&ocirc;n vinh sự đẹp tự nhi&ecirc;n của sợi vải, t&aacute;c phẩm nghệ thuật n&agrave;y trang tr&iacute; tr&ecirc;n tường với phong c&aacute;ch tối giản ấm &aacute;p v&agrave; độ sần nhẹ nh&agrave;ng của những n&eacute;t vẽ bằng cọ tay. Tấm vải canvas được bọc s&aacute;t v&agrave;o khung gỗ c&oacute; ho&agrave;n thiện tự nhi&ecirc;n v&agrave; c&oacute; thể treo ngang hoặc dọc. Patchwork White l&agrave; sản phẩm độc quyền của Crate and Barrel.</p>\r\n<p>T&aacute;c phẩm nghệ thuật tr&ecirc;n tường \"Patchwork White\" Framed Hand-Painted Raw Canvas c&oacute; k&iacute;ch thước 40 \"x19\" 40 \"Wx2.25\" Dx19 \"H Vẽ v&agrave; khung tay Vải canvas th&ocirc; bọc khung gỗ Sơn Tre hoặc phơi ngang Cơ chế treo v&ograve;ng D Lau ch&ugrave;i bằng vải mềm v&agrave; kh&ocirc;</p>',NULL,'aa1-64514fe8eb501.jpg','tranh40x19',1,8048495.00,0.00,0,0,'public',' 5,',1,0,0,0,0,'2023-05-02 18:01:13','2023-05-03 06:16:51',8),(132,17,5,'Tranh 31.5x1.8','tranh-315x18','standard',NULL,'<p>Giấy cắt tay được xếp chồng cẩn thận để tạo ra những v&ograve;ng tr&ograve;n phức tạp đầy chi tiết tinh xảo. Giấy m&agrave;u kem kết hợp tuyệt vời với nền vải lanh tự nhi&ecirc;n, hai vật liệu mỗi vật liệu đều c&oacute; độ sần nhẹ nh&agrave;ng v&agrave; sự thu h&uacute;t hữu cơ. Khung th&ocirc;ng đen tạo ra sự tương phản, kh&ocirc;ng chỉ bởi t&ocirc;ng m&agrave;u đen đậm m&agrave; c&ograve;n bởi những đường n&eacute;t sắc n&eacute;t.</p>\r\n<p>T&aacute;c phẩm nghệ thuật tr&ecirc;n tường \"Natural Circles\" Framed Hand-Crafted Paper c&oacute; k&iacute;ch thước 31.5 \"x1.8\" 31.5 \"vu&ocirc;ng x 1.8\" D L&agrave;m thủ c&ocirc;ng Giấy tr&ecirc;n nền vải lanh dưới k&iacute;nh Khung th&ocirc;ng đen Tre bằng v&ograve;ng D được cung cấp Treo dọc Lau ch&ugrave;i sạch bằng vải mềm Nhập khẩu</p>',NULL,'1-645150d29360f.jpg','tranh31.5x1.8',1,5842785.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-02 18:05:06','2023-05-03 06:17:16',8),(133,17,5,'Tranh Đôi','tranh-doi','standard',NULL,'<p>Được bao quanh bởi bờ biển nhiệt đới mờ ảo, biển động với những đợt s&oacute;ng đầy bọt trắng trong hai bức ảnh đen trắng với những cảnh quan nhiệt đới mờ ảo lung linh ph&iacute;a sau. Sự tinh tế của c&aacute;c m&agrave;u x&aacute;m v&agrave; chi tiết tinh tế của những h&igrave;nh ảnh dịu nhẹ n&agrave;y đều mang lại sự suy ngẫm, l&agrave;m cho Early Bay trở th&agrave;nh một sự bổ sung tuyệt vời cho ph&ograve;ng ngủ hoặc ph&ograve;ng kh&aacute;ch. Được đ&oacute;ng khung dưới k&iacute;nh trong c&aacute;c khung b&oacute;ng m&agrave;u x&aacute;m, mỗi bức ảnh được in gicl&eacute;e tr&ecirc;n một tấm giấy m&agrave;u nước nghệ thuật với cạnh x&eacute; tay.</p>\r\n<p>T&aacute;c phẩm nghệ thuật tr&ecirc;n tường \"Early Bay\" Framed Wall Art Print, Set of 2 c&oacute; k&iacute;ch thước 41.5 \"Wx2\" Dx30.5 \"H In gicl&eacute;e tr&ecirc;n giấy m&agrave;u nước cạnh x&eacute; tay Được treo l&ecirc;n một lớp l&oacute;t trắng Khung b&oacute;ng m&agrave;u x&aacute;m với k&iacute;nh Treo ngang Tre bằng v&ograve;ng D được cung cấp Lau ch&ugrave;i sạch bằng vải mềm, kh&ocirc;</p>',NULL,'-645151e9e4026.jpg','tranhdoi',1,2578804.00,0.00,0,0,'public',' 5,',1,0,0,0,1,'2023-05-02 18:09:46','2023-05-03 06:17:34',8),(134,17,5,'piano5feet','piano5feet','standard',NULL,'<h4>It starts with over&nbsp;12,000&nbsp;parts, fashioned from the finest aged woods and the world&rsquo;s most advanced materials. Each piece is assembled by artisans in a tradition of old world craftsmanship. When it all comes together, and you touch the perfectly balanced keys and hear the rich harmonics and subtle, silky colors, you know it&rsquo;s not just any grand piano. It&rsquo;s a Yamaha.</h4>',NULL,'piano5feet-64526d9e32724.jpg','GB1K',-1,0.00,0.00,0,0,'public',' 5,',1,0,0,0,0,'2023-05-03 14:20:14','2023-05-03 14:20:14',8),(135,17,5,'piano5feet3in','piano5feet3in','standard',NULL,'<h4 role=\"presentation\" aria-level=\"3\">It starts with over&nbsp;12,000&nbsp;parts, fashioned from the finest aged woods and the world&rsquo;s most advanced materials. Each piece is assembled by artisans in a tradition of old world craftsmanship. When it all comes togeth